Limits are for those that need them.

@easymoneysniper proves that staying hungry is what fuels greatness. 

Never shying away from the moment is why we Play New.

@Giannis_an34’s on-court success isn’t the only part of his story. Rather, it’s who he’s inspired as a result. The space he makes for himself creates new opportunities for his family, peers, community, and the future of the game. 

“I came from poverty, like Giannis. We had that same start. But just seeing what he’s done, that you can go from the bottom to the top like that, it shows us that no matter how your story was written, if you believe in yourself and put the work in, you can get there too,” says @jacarriecarr, CEO and founder of @jkfk_nonprofit.

Giannis makes room for anyone and everyone to be their own first. The space you create by being first, opens up the door for others to follow your lead. While Giannis has been the first of many things, he certainly won’t be the last. Visit the Nike App to read up on how the Milwaukee Bucks power forward impacts his community. #TheFirstOfMany #ZoomFreak3
